// src/pages/DashboardPage.js

import React from 'react';
import { Link } from 'react-router-dom';

function DashboardPage() {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-100">
      <h1 className="text-3xl font-bold mb-6">Dashboard</h1>
      <div className="w-full max-w-md bg-white p-4 rounded-lg shadow-lg">
        <h2 className="text-2xl font-semibold mb-4">Welcome to your Dashboard</h2>
        <div className="mt-4">
          <Link
            to="/settings"
            className="w-full bg-indigo-600 text-white p-2 rounded-md hover:bg-indigo-700 transition duration-300 block text-center mb-2"
          >
            Account Settings
          </Link>
          <Link
            to="/control-device"
            className="w-full bg-indigo-600 text-white p-2 rounded-md hover:bg-indigo-700 transition duration-300 block text-center"
          >
            Control Device
          </Link>
        </div>
      </div>
    </div>
  );
}

export default DashboardPage;
